### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Discrete Random Variables**
   - **Distributions**:
     - **Uniform Distribution**: \( P(X = k) = \frac{1}{n} \), \( E[X] = \frac{a+b}{2} \), \( \text{Var}(X) = \frac{n^2-1}{12} \)
     - **Bernoulli Distribution**: \( P(X = k) = p^k (1-p)^{1-k} \), \( E[X] = p \), \( \text{Var}(X) = p(1-p) \)
     - **Binomial Distribution**: \( P(X = k) = ^nC_k p^k (1-p)^{n-k} \), \( E[X] = np \), \( \text{Var}(X) = np(1-p) \)
     - **Geometric Distribution**: \( P(X = k) = (1-p)^{k-1} p \), \( E[X] = \frac{1}{p} \), \( \text{Var}(X) = \frac{1-p}{p^2} \)
     - **Poisson Distribution**: \( P(X = k) = \frac{e^{-\lambda} \lambda^k}{k!} \), \( E[X] = \lambda \), \( \text{Var}(X) = \lambda \)

#### 2. **Continuous Random Variables**
   - **Distributions**:
     - **Uniform Distribution**: \( f_X(x) = \frac{1}{b-a} \), \( E[X] = \frac{a+b}{2} \), \( \text{Var}(X) = \frac{(b-a)^2}{12} \)
     - **Exponential Distribution**: \( f_X(x) = \lambda e^{-\lambda x} \), \( E[X] = \frac{1}{\lambda} \), \( \text{Var}(X) = \frac{1}{\lambda^2} \)

#### 3. **Normal Distribution**
   - **Standard Normal Distribution**: \( Z = \frac{X - \mu}{\sigma} \)
   - **Probability Calculations**: \( P(X^2 > 16) \) using standard normal tables.

#### 4. **Moment Generating Functions (MGF)**
   - **Definition**: \( M_X(\lambda) = E[e^{\lambda X}] \)
   - **Properties**: \( M_{X+Y}(\lambda) = M_X(\lambda) \times M_Y(\lambda) \) for independent \( X \) and \( Y \)

#### 5. **Expectation and Variance**
   - **Linearity of Expectation**: \( E[aX + b] = aE[X] + b \)
   - **Variance Properties**: \( \text{Var}(aX + b) = a^2 \text{Var}(X) \)
   - **Covariance**: \( \text{Cov}(T, W) = E[(T - E[T])(W - E[W])] \)

#### 6. **Conditional Probability**
   - **Definition**: \( P(X < 1 | Y = 2) \)
   - **Conditional PDF**: \( f_{X|Y}(x|y) = \frac{f_{X,Y}(x,y)}{f_Y(y)} \)

#### 7. **Central Limit Theorem (CLT)**
   - **Approximation**: For large \( n \), \( Y = \sum_{i=1}^{n} X_i \) is approximately normal.
   - **Mean and Variance**: \( Y \sim \text{Normal}(n\mu, n\sigma^2) \)

#### 8. **Chebyshev's Inequality**
   - **Definition**: \( P(|Y - \mu| \geq k\sigma) \leq \frac{1}{k^2} \)

#### 9. **Probability Density Function (PDF)**
   - **Uniform Distribution over a Region**: \( f_{X,Y}(x,y) = \frac{1}{\text{Area of D}} \)
   - **Marginal PDF**: \( f_X(x) = \int_{-\infty}^{\infty} f_{X,Y}(x,y) dy \)

